import React from "react";

const YoutubeComp = (props) => {
  return (
    <div className="youtube-wrapper">
      <div className="img-thumb">
        <p className="time">10.00</p>
      </div>
      <p className="title"></p>
      <p className="desc"></p>
    </div>
  );
};

export default YoutubeComp;
